import React, { Component } from 'react'
import { Menu } from 'semantic-ui-react'
import SubMenu from '../components/Menu'

export default class MenuExampleBasic extends Component {
  render() {
    return (
      <Menu fixed='right'>
        <SubMenu/>
      </Menu>
    )
  }
}
